import React from 'react';

const Benefits = () => {
    return (
        <>
            <h1>Benefits of Electric Vehicles</h1>
            <p>Electric vehicles offer several environmental benefits:</p>
            <ul>
                <li>Zero emissions: EVs produce no tailpipe emissions, reducing air pollution.</li>
                <li>Reduced greenhouse gas emissions: EVs contribute to a lower carbon footprint compared to traditional gasoline vehicles.</li>
                <li>Energy efficiency: EVs are more energy-efficient compared to internal combustion engine vehicles.</li>
            </ul>
        </>
    )
}
export default Benefits;
